import React, { useState, useEffect } from "react";

const Users = () => {
    const [User, setUser] = useState([]);

    const showUser = async () => {
        const responseApi = await fetch(`http://localhost:8002/api/view-user`);
        const fetchData = await responseApi.json();
        setUser(fetchData.data);
    };

    useEffect(() => {
        showUser();
    }, []);

    return (
        <div>
            <h2>User List</h2>
            <table className="user-table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Email</th>
                        {/* Add more headers based on your API response */}
                    </tr>
                </thead>
                <tbody>
                    {User.map((user) => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.name}</td>
                            <td>{user.email}</td>
                           <td>{user.gender}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Users;
